/**
 * @param {string[]} words
 */
var WordFilter = function (words) {
  this.triePrefix = {}
  this.trieSuffix = {}
  this.cache = {}
  this.words = words.map(x => [
    x,
    x.split('').reverse()
  ])
  this.words.forEach(([word, reversed], i) => this.add(word, reversed, i))
};

/** 
 * @param {string} prefix 
 * @param {string} suffix
 * @return {number}
 */
WordFilter.prototype.f = function (prefix, suffix) {
  let cacheKey = prefix + '_' + suffix
  if (this.cache[cacheKey] !== undefined) return this.cache[cacheKey]
  this.cache[cacheKey] = this.fUncached(prefix, suffix)
  return this.cache[cacheKey]
};

WordFilter.prototype.fUncached = function (prefix, suffix) {
  let parr = trieTest(this.triePrefix, prefix),
    sset = new Set(trieTest(this.trieSuffix, suffix.split('').reverse()))
  parr.sort((a,b)=>b-a)
  // if(prefix=='aba'&&suffix=='bbbbaa')debugger
  for (let i of parr) {
    if (sset.has(i)) return i
  }
  return -1
};


WordFilter.prototype.add = function (word, reversed, i) {
  str2trie(this.triePrefix, word, i)
  str2trie(this.trieSuffix, reversed, i)
};


function str2trie(obj, word, key = 0) {
  let t = obj
  for (let char of word) {
    if (!t[char]) t[char] = { '': [key] }
    else t[char][''].push(key)
    t = t[char]
  }
}

function trieTest(obj, word) {
  let t = obj
  for (let char of word) {
    t = t[char]
    if (!t) return []
  }
  return t['']
}


